import io from 'socket.io-client';

class socketResult{

    token = localStorage.getItem('accessToken');
    socket = io('http://localhost:4000/term',{
        query: { token }
    }); // NestJS 서버 주소

     getMessage () {
        socket.on('message',async (payload)=>{
            return await payload;
        });
    }
     sendMessage (message) {
        socket.emit('message',message);
    }
}

export  {socketResult};
